 switch (tempVars("facts")) {
   case 1: var t = "**Coffee dates back to 800 A.D.**\nLegend has it that 9th-century goat herders noticed the effect caffeine had on their goats, who appeared to dance after eating the fruit of the Coffea plant. A local monk then made a drink with the produce and found that it kept him awake at night, thus the original cup of coffee was born"; break;
   case 2: var t = "**Coffee beans are technically seeds.**\nThey're the pits of the cherry-like berries found on the flowering shrubs, but we call them beans because of the resemblance to legumes."; break;
   case 3: var t = "**You can eat coffee cherries as a food.**\nEarly on, people mixed coffee berries with fat to create an energy-rich snack ball, according to PBS. They would also ferment the pulp to make a wine-like drink."; break;
   case 4: var t = "**There are two main types of coffee: Arabica and Robusta.**\nGrowers predominantly plant the Arabica species. Although less popular, Robusta tastes slightly more bitter and contains more caffeine."; break;
   case 5: var t = "**Brazil grows the most coffee in the world.**\nToday, Brazil produces about third of the world's supply, according to the International Coffee Organization, about twice as much as the second place holder, Vietnam."; break;
   case 6: var t = "**Only two U.S. states produce coffee.**\nKona coffee is the United States' gift to the coffee world. Because coffee traditionally grows best in climates along the equator, Hawaii's weather is optimal for harvesting beans. California also recently got into the coffee game with dozens of farms now churning out pricey premium bags."; break;
   case 7: var t = "**Espresso means pressed out in Italian.**\nThis refers to the way espresso is made — forcing boiling water through pressed coffee grounds. And although espresso has more caffeine per volume than coffee, it would take three shots to equal the amount in a regular cup of joe."; break;
   case 8: var t = "**The world's most expensive coffee can cost more than $600 a pound.**\nOne of the most coveted varieties comes from the feces of an Asian palm civet. The cat-like creature eats fruit including coffee cherries, but is unable to digest the beans. The excreted seeds produce a smooth, less acidic brew called kopi luwak, but the means of production has drawn criticism from animal welfare activists."; break;
   case 9: var t = "**Multiple people/countries have tried to ban coffee.**\nBack in 1511, leaders in Mecca believed it stimulated radical thinking and outlawed the drink. Some 16th-century Italian clergymen also tried to ban coffee because they believed it to be satanic. However, Pope Clement VII loved coffee so much that he lifted the ban and had coffee baptized in 1600. Even as recently as the 18th century, the Swedish government made both coffee and coffee paraphernalia (including cups and dishes) illegal for its supposed ties to rebellious sentiment."; break;
   case 10: var t = "**You can overdose on coffee.**\nDon't worry, you would need to drink about 30 cups in a very short period time to get close to a lethal dose of caffeine."; break;
   case 11: var t = "**Finland is home to the biggest coffee lovers.**\nThe average adult Finn goes through 27.5 pounds of coffee each year, according to the International Coffee Organization. Compare that to a measly 11 pounds per American."; break;
   case 12: var t = "**Coffee drinkers tend to live longer.**\nResearch has linking moderate consumption (about three to four cups per day) with a longer life span, plus a reduced risk of cardiovascular disease, type 2 diabetes and Parkinson's, according to Harvard Health Publishing."; break;
   case 13: var t = "**The largest cup of coffee ever filled a 9-foot tall cup.**\nThe 3,487-gallon serving earned a Guiness World Record in 2012."; break;
   case 14: var t = "**The Boston Tea Party helped popularize coffee in America.**\nIn the lead up to the Revolutionary War, it became patriotic to sip java in lieu tea, of PBS reveals. The Civil War also made the drink more pervasive because it helped energize tired troops."; break;
   case 15: var t = "**Decaf does not mean caffeine-free.**\nAn eight-ounce brewed cup of decaf coffee actually contains two to 12 milligrams of caffeine, the Mayo Clinic states. In comparison, a regular cup of coffee supplies between 95 to 200 milligrams, while one can of cola has aout 23 to 35 milligrams of caffeine."; break;
   case 16: var t = "**The word coffee comes from the Arabic word for wine.**\nQahwah later became kahveh in Turkish, and then koffie in Dutch, which is where we get the English word coffee."; break;
   case 17: var t = "**Starbucks opens an average of two stores per day.**\nYou can now order grande lattés at more than 29,000 locations around the globe, 47 years after the first store launched in Seattle."; break;
   case 18: var t = "**One cup of black coffee only has one calorie.**\nAdding sweeteners, cream, and other mix-ins can quickly jack up the total. A venti Java Chip Frappuccino from Starbucks contains 88 grams of sugar and 600 calories — more than a McDonald's Big Mac!"; break;
   case 19: var t = "**Teddy Roosevelt reportedly coined Maxwell House's slogan.**\nOur nation's 26th president loved coffee so much that one of his son's described his custom cup as more in the nature of a bathtub, according to Smithsonian.com. On a 1907 visit to Andrew Jackson's former estate, the commander in chief supposedly dubbed a cup of Maxwell House joe, good to the last drop, a catchphrase still used today."; break;
   case 20: var t = "**You can order coffee 25,000 different ways at Dunkin'.**\nThe recently renamed doughnut chain did the math on its customizable java drinks. It sells 2 billion cups globally per year, enough for customers to pick each option 80,000 times."; break;
   case 21: var t = "**The grounds can beautify your skin.**\nSave your leftover beans for a DIY scrub. Coffee grounds are physical exfoliators that can lift off dead skin cells, making skin feel smooth and look brighter, says Good Housekeeping Beauty Lab chemist Danusia Wnek. And caffeine is thought to improve blood circulation in skin, but there isn't yet sufficient clinical data on its use in topical products."; break;
   case 22: var t = "**Coffee is gross!**\nThorton says coffee is gross :face_vomiting:"; break;
 }
this.storeValue(t, 1, 'var_facts', cache);
